let input = ``;

let units = Array.from(new Set(input.toUpperCase().split('').sort()));

function collapse(badUnit) {
  badUnit = badUnit || '';
  const regex = new RegExp(badUnit, 'ig');
  let polymer = input.replace(regex, '').split('');
  let changeMade;
  let cleared = 0;
  do {
    changeMade = false;
    for (let i = cleared; i < polymer.length - 1; i++) {
      const unit1 = polymer[i];
      const unit2 = polymer[i + 1];
      const sameUnit = unit1.toUpperCase() === unit2.toUpperCase();
      if (sameUnit) {
        const differentPolarity = unit1 !== unit2;
        if (differentPolarity) {
          polymer.splice(i, 2);
          changeMade = true;
          cleared = Math.max(0, i - 1);
          break;
        }
      }
    }
  } while (changeMade);
  return polymer.length;
}

console.log(collapse());
console.log(Math.min(...units.map(collapse)));

function collapseStack(badUnit) {
  badUnit = (badUnit || '').toUpperCase();
  let collapsed = [];
  for (let i = 0; i < input.length; i++) {
    const unit = input[i];
    if (unit.toUpperCase() === badUnit) {
      continue;
    }
    const peek = collapsed[collapsed.length - 1];
    if (peek && peek.toUpperCase() === unit.toUpperCase() && peek !== unit) {
      collapsed.pop();
    } else {
      collapsed.push(unit);
    }
  }
  return collapsed.length;
}

console.log(collapseStack());
console.log(Math.min(...units.map(collapseStack)));
